import * as React from 'react';
import './App.css';
import NavBar from './Components/NavBar/NavBar';
import TrackCart from './Components/NavBar/TrackCart';

function App() {
  return (<div style={{height: '100%'}}>
    <div className="App">
    <NavBar />
    <TrackCart />
    </div>
    <div className='content-view'  style={{height: '100%'}}>
      <div>
        Shop for $5000 
      </div>
    </div>
    </div>
  );
}

export default App;
